    <>
    <img src={require('../img/products/new-arrivals/Four_Design_TOHAKU_Candle_Group-1_600x.jpg')} alt="" />
    <div>{toString(products[0].imgUrl=='../img/products/new-arrivals/Four_Design_TOHAKU_Candle_Group-1_600x.jpg')}</div>
    </>

  );
}

export default Products;
